import React from 'react';
import './Login.css';
import policeLogo from './mumbai_logo.png';
const Login = () => {
  return (
    <div className="login-container">
      <div className="left-section">
        <img src="mumbai_logo.png" alt="Maharastra Police Logo" className="police-logo" />
        <h2>e-Muddamaal Management System</h2>
      </div>
      <div className="right-section">
        <div className="login-box">
          <h2>Login</h2>
          <input type="text" placeholder="Enter username" className="login-input" />
          <input
            type="password"
            placeholder="Enter password"
            className="login-input"
          />
          <button className="login-button">Login</button>
          <a href="#" className="forgot-password">Forgot <span>Password?</span></a>
          <p>Don't have an account? <a href="#">Sign up</a></p>
        </div>
      </div>
    </div>
  );
};

export default Login;
